body:
I
Hermano dinos hoy algo de Jesús,
Dinos otra vez la historia de Su amor;
Declaranos la fe, gozo y gratitud, 
Dinos otra vez las historia de Su amor;
¿Sigues todavía cerca del Seño?, ¿Arde tu alma del primer amor?
¿Está tu copa llena de bendición?, Dinos otra vez la historia de Su amor.

Coro
Dinos otra vez la historia, del amor del Salvador;
Tan bendita y grata historia,Nos hará cantar Su Gloria,
Dinos otra vez la historia de Su amor.

II
Al escuchar tu voz que habla del Señor, 
Dinos otra vez la historia de Su amor;
Tal vez un pecador se convierta a Dios;
Dinos otra vez la historia de Su amor;
Muchos tienen sed en su corazón, En el mundo buscan diversión,
Señalales la fuente de bendición,Dinos otra vez la historia de Su amor.

III
La ayuda que te ha dado en la tentación,
Dinos otra vez la historia de Su amor;
Las pruebas de tu fe y Su compasión,
Dinos otra vez la historia de Su amor;
Dinos que Jesús es amigo fiel, que es tu Capitán y Gran Pastor;
Socorro oportuno has hallado en él,Dinos otra vez la historia de Su amor.

I
Más profundo que el óceano y ancho más que el mar,
es la gracia de mi Salvador, que me compró,
enviado por el Padre y él es mío hoy;
pues Su gracia redentora ya lavó mi ser.
Su gracia, me alcanzó,
Si Su gracia me alcanzó;
Y desde ahora hasta la eternidad,
Y yo ahora suyo soy y feliz siempre estoy,
Al saber que Su gracia me alcanzó.

II
Más alto que los montes y brillante más que el sol;
es el amor de mi Jesús por tí y por mí,
Dejó sus riquezas y por mí se humilló;
Sólo así yo fui salvó pues su sangre me lavó;
Su gracia, me alcanzó,
Si Su gracia me alcanzó;
Y desde ahora hasta la eternidad,
Y yo ahora suyo soy y feliz siempre estoy,
Al saber que Su gracia me alcanzó.

I
La lucha ya terminó, 
El tiempo ya cesó,
Escucha la voz de Dios 
Que dice con amor:

Coro
Descansar, (descansar); 
Descansar, (descansar);
Descansar, (descansar); 
Descansar, (descansar);
Descansar, (descansar).

II
El siervo ya cumplió, carrera terminó;
Su premio recibirá de manos del Señor:

III
Como soldado luchó, su vida entregó;
Corona se le dará, Su triunfo viene ya.

III
Hnas. Cantan el coro dos veces.
Hnos. Cantan las estrofas 2 y 3.

I
Pon tus ojos en los ojos del Señor de Galilea,
Pon tus ojos en los ojos del Señor que calma la mar;
Si el Señor vive hoy y por siempre vivirá,
Pon tus ojos en los ojos del Señor que calma la mar.

II
Pon tus manos en las manos del Señor de Galilea,
Pon tus manos en las manos del Señor que calma la mar;
Si el Señor vive hoy y por siempre vivirá,
Pon tus manos en las manos del Señor que calma la mar.

III
Pon tus pasos en los pasos del Señor de Galilea,
Pon tus pasos en los pasos del Señor que calma la mar;
Si el Señor vive hoy y por siempre vivirá,
Pon tus pasos en los pasos del Señor que calma la mar.

IV
Pon tus ojos y tus manos y tus pasos;
en los ojos, en las manos y en los pasos del Señor de Galilea,
Pon tus ojos y tus manos y tus pasos;
en los ojos, en las manos y en los pasos del Señor que calma la mar;
Si el Señor vive hoy y por siempre vivirá,
Pon tus ojos y tus manos y tus pasos;
en los ojos, en las manos y en los pasos del Señor que calma la mar;

I
De placeres mundanales, Ya no me hablen más a mí;
Ni de vanas iluciones, Porque Cristo recibí;
De estas cosas ya soy libre, Cristo mi Maestro fiel;
Mi alma entera le he rendido, Pertenezco sólo a El.

Coro
Cristo es mi Maestro   (Cristo Salvador, Mi Maestro es El)
Quiero amarle fiel                   (Quiero amarle fiel)
Ya no soy mi dueño                 (Mi Maestro es El)
Mas pertenezco a él      (Sólo pertenezco, sólo a él.)

II
Dulce paz nos proporciona, Sólo a él pertenecer;
Aunque pobres, con su gracia, El nos puede enriquecer,
Salvador, sé mi Maestro, Guárdame Señor Jesús;
Dígnate vivir conmigo Y andaré siempre en tu luz.

III
Alma triste, de ti misma; Dueña tú no puedes ser;
Ríndete hoy a tu Maestro, Sólo a él pertenecer,
Sufrió Cristo por salvarte; Y su vida dió por tí,
Hoy su gracia satisface, Al que la recibe aquí.

I
Somos de una familia, Que se bautizó,
Somos de una familia, Que sobrepasa el amor;
Pues Jesús nos ha salvado, E hizo suyos,
Somos Ya Una Familia Que Va Al Cielo

Coro
Y Hay veces reimos juntos, Hay veces lloramos;
Y Hay veces sentimos  juntos, llanto & dolor;
Y Hay veces soñamos juntos: ¿El Cómo Será?
Cuando al cielo lleguemos “La Familia De Dios”.


II
Cuando alguno se duele, Nos dolemos con él;
Cuando alguno se goza, Nos gozamos con él;
Sea así en el día, Y así en lluvia,
Juntos En Victoria Al Cielo Vamos.

III 
Y algunos parten primero, Allá les veremos;
Y algunos mueren primero, Nos reuniremos;
No habrá más tristeza, Ni separación;
Juntos en el cielo Eterna Sión.

I
Cristo, Cristo, Cristo en la mañana, Cristo en la tarde;
Cristo, Cristo, Cristo cuando apague el sol.

II
Cantaré, cantaré, canto en la mañana, Canto en la tarde;
Canto, canto, canto cuando apague el sol.

III
Serviré, Serviré, Sirvo en la mañana, Sirvo en la tarde;
Sirvo, sirvo, sirvo cuando apague el sol.

IV
Amaré, amaré, amo en la mañana, amo en la tarde;
Amo, amo, amo cuando apague el sol.

V
Seguiré, seguiré, sigo en la mañana, sigo en la tarde;
Sigo, sigo, sigo cuando apague el sol.

VI
Cristo, Cristo, Cristo en la mañana, Cristo en la tarde;
Cristo, Cristo, Cristo cuando apague el,
Cristo cuando apague el;
